function getDateShowTime(nameTheater) {
  return {
    type: "GET_DATE_SHOWTIME",
    payload: nameTheater,
  };
}
function showDateOnMenu(data) {
  return {
    type: "SHOW_DATE_ON_MENU",
    status: data,
  };
}
export { showDateOnMenu };
function resetTimeByDate(status) {
  return {
    type: "RESET_TIME_BY_DATE",
